INSERT INTO `Games` VALUES (2,'Minecraft','Minecraft is a sandbox video game created by Swedish developer Markus Persson, released by Mojang in 2011 and purchased by Microsoft in 2014. It is the second best-selling video game of all time, selling over 180 million copies across all platforms by late 2019, with over 112 million monthly active players.\r\n\r\nIn Minecraft, players explore an intentionally blocky, pixelated, procedurally-generated 3D world, and may discover and extract raw materials, craft tools, build structures or earthworks, and, depending on game mode, can fight computer-controlled foes, as well as either cooperate with or compete against other players in the same world. These modes include a survival mode, in which players must acquire resources to build the world and maintain health, and a creative mode, where players have unlimited resources. In the Java Edition, players can modify the game with mods to create new gameplay mechanics, items, textures and assets.\r\n\r\nMinecraft has been critically acclaimed, winning numerous awards, and has been described as one of the most influential and greatest video games of all time. Social media, parodies, adaptations, merchandise, and the annual MineCon conventions played large roles in popularizing the game. It has also been used in educational environments, especially in the realm of computing systems, as virtual computers and hardware devices have been built in it. A number of spin-off games have also been developed, such as Minecraft: Story Mode, Minecraft Earth, and Minecraft Dungeons.',27,3,2011,'2020-03-24 23:31:52',NULL,'','\0'),(4,'Red Dead Redemption 2','Red Dead Redemption 2 is a 2018 action-adventure game developed and published by Rockstar Games. The game is the third entry in the Red Dead series and is a prequel to the 2010 game Red Dead Redemption. The story is set in 1899 in a fictionalized representation of the Western, Midwestern and Southern United States and follows outlaw Arthur Morgan, a member of the Van der Linde gang. Arthur must deal with the decline of the Wild West whilst attempting to survive against government forces, rival gangs, and other adversaries. The story also follows fellow gang member John Marston, the protagonist of Red Dead Redemption.\r\n\r\nThe game is presented through both first and third-person perspectives, and the player may freely roam in its interactive open world. Gameplay elements include shootouts, heists, hunting, horseback riding, interacting with non-player characters (NPCs), and maintaining the character\'s honor rating through moral choices and deeds. A bounty system similar to the \"wanted\" system from the Grand Theft Auto franchise governs the response of law enforcement and bounty hunters to crimes committed by the player. Red Dead Redemption 2 was released for the PlayStation 4 and Xbox One in October 2018, and for Microsoft Windows and Stadia in November 2019. Red Dead Online, the online multiplayer mode of the game, was released as a beta version in November 2018 before a full release in May 2019.',1,45,2018,'2020-03-25 17:31:22',NULL,'\0',''),(5,'Dark Souls 3','Dark Souls III is an action role-playing video game developed by FromSoftware and published by Bandai Namco Entertainment for PlayStation 4, Xbox One, and Microsoft Windows. A part of the Souls series, the game was released in Japan in March 2016 and worldwide a month later. Two downloadable content (DLC) expansions, Ashes of Ariandel and The Ringed City, were also made for the game.\r\n\r\nDark Souls III was critically and commercially successful, with critics calling it a worthy and fitting conclusion to the series. It was the fastest-selling game in Bandai Namco\'s history, shipping over three million copies worldwide within its first two months. A complete version containing the base game and both expansions, titled Dark Souls III: The Fire Fades, was released in April 2017.',7,5,2016,'2020-03-25 17:42:10',NULL,'','\0'),(6,'Doom','Doom is a first-person shooter video game developed by id Software and published by Bethesda Softworks. It was released worldwide on Windows, PlayStation 4, and Xbox One in May 2016 and is powered by id Tech 6. A port for Nintendo Switch was co-developed with Panic Button and released in November 2017. A reboot of the Doom franchise, it is the fourth title in the main series and the first major installment since Doom 3 in 2004.\r\n\r\nDoom was announced as \"Doom 4\" in 2008, and that version underwent an extensive development cycle with different builds and designs before the game was restarted in 2011 and revealed as simply \"Doom\" in 2014. It was tested by customers who pre-ordered the 2014 Bethesda game Wolfenstein: The New Order and also by the general public. Mick Gordon composed the music for the game, with additional music contributed by Ben F. Carney, Chris Hite, and Chad Mossholder.',18,40,2016,'2020-03-25 17:43:38',NULL,'\0','\0'),(7,'Battlefield 1','Battlefield 1 is a first-person shooter video game developed by EA DICE and published by Electronic Arts. Battlefield 1 is the fifteenth installment in the Battlefield series, and the first main entry in the series since Battlefield 4. It was released worldwide for Microsoft Windows, PlayStation 4, and Xbox One on October 21, 2016.\r\n\r\nBattlefield 1 received positive reviews by critics and was seen as an improvement over the series\' previous installments, Battlefield 4 and Battlefield Hardline. Most of the praise was directed towards its World War I theme, single-player campaigns, multiplayer modes, visuals, and sound design. It was a commercial success, selling over 15 million copies. The next game in the franchise, Battlefield V, was announced on May 23, 2018 and was released on November 20, 2018.',9,39,2016,'2020-03-25 17:45:57',NULL,'\0',''),(8,'Uncharted 4: A Thief\'s End','Uncharted 4: A Thief\'s End is a 2016 action-adventure game developed by Naughty Dog and published by Sony Computer Entertainment. It is the fourth main entry in the Uncharted series. Players control Nathan Drake, a former treasure hunter coaxed out of retirement by his estranged brother Samuel. With Nathan\'s longtime partner, Sullivan, they search for clues for the location of Henry Avery\'s long-lost treasure. A Thief\'s End is played from a third-person perspective, and incorporates platformer elements. Players solve puzzles and use firearms, melee combat, and stealth to combat enemies. In the online multiplayer mode, up to ten players engage in co-operative and competitive modes.\r\n\r\nDevelopment of Uncharted 4 began in 2011, soon after the release of Uncharted 3: Drake\'s Deception. It was led by creative director Amy Hennig and game director Justin Richmond. Development was hampered in 2014 due to Hennig and Richmond\'s departure from Naughty Dog; they were replaced by Neil Druckmann and Bruce Straley. The team sought to incorporate elements of open-world gameplay, with larger levels to encourage free-roaming exploration and combat. The relationship between Nathan and Elena was central, and Naughty Dog attempted to humanize them more than in previous games. A Thief\'s End was released in May 2016 for the PlayStation 4. It was Naughty Dog\'s first game developed specifically for the PlayStation 4. The team took advantage of the advanced hardware to process larger dynamic environments.',3,38,2016,'2020-03-25 17:48:10',NULL,'\0','\0'),(9,'Overwatch','Overwatch is a team-based multiplayer first-person shooter developed and published by Blizzard Entertainment. Described as a \"hero shooter\", Overwatch assigns players into two teams of six, with each player selecting from a roster of over 30 characters, known as \"heroes\", each with a unique style of play that is divided into three general roles that fit their purpose. Players on a team work together to secure and defend control points on a map or escort a payload across the map in a limited amount of time. Players gain cosmetic rewards that do not affect gameplay, such as character skins and victory poses, as they play the game. The game was initially launched with only casual play, but a competitive ranked mode, various \'arcade\' game modes, and a player-customizable server browser were added after release. Additionally, Blizzard has added new characters, maps, and game modes post-release, all free of charge, with the only additional cost to players being optional loot boxes to earn cosmetic items. It was released for PlayStation 4, Xbox One, and Windows in May 2016, and Nintendo Switch in October 2019.',26,37,2016,'2020-03-25 17:50:09',NULL,'','\0'),(10,'Star Wars Jedi: Fallen Order','Star Wars Jedi: Fallen Order is an action-adventure game developed by Respawn Entertainment and published by Electronic Arts. It was released for Windows, PlayStation 4, and Xbox One on November 15, 2019. The game is set in the Star Wars universe, five years after the film Star Wars: Episode III – Revenge of the Sith and 14 years before Star Wars: Episode IV – A New Hope, and follows a young Jedi Padawan named Cal Kestis as he is hunted through the galaxy by the Galactic Empire, while trying to complete his Jedi training and restore the now wiped out Jedi Order. The game was announced during E3 2018, with a more detailed reveal during the Star Wars Celebration in April 2019. The game received generally favorable reviews from critics and sold more than eight million copies by the end of January 2020.',9,1,2019,'2020-03-25 17:52:52',NULL,'\0','\0'),(11,'Resident Evil 2 (Remake)','Resident Evil 2 is a survival horror game developed and published by Capcom. A remake of the 1998 game Resident Evil 2, it was released for Windows, PlayStation 4, and Xbox One on January 25, 2019. Players control rookie police officer Leon S. Kennedy and student Claire Redfield as they attempt to escape Raccoon City during a zombie apocalypse.\r\n\r\nCapcom considered remaking Resident Evil 2 following the successful release of the remake of the first Resident Evil in 2002. It was delayed as series creator Shinji Mikami did not want to divert development from Resident Evil 4 (2005). Capcom announced the Resident Evil 2 remake in August 2015, and released the first trailer and gameplay footage at E3 2018.\r\n\r\nResident Evil 2 received acclaim, with praise for its presentation, gameplay, and faithfulness to the original. It was nominated for several awards, including numerous \"game of the year\" awards. By December 2019, it had sold over five million copies, outselling the original.',11,4,2019,'2020-03-25 17:56:53',NULL,'\0','\0'),(12,'The Legend of Zelda: Breath of the Wild','The Legend of Zelda: Breath of the Wild is an action-adventure game developed and published by Nintendo, released for the Nintendo Switch and Wii U consoles on March 3, 2017. Breath of the Wild is set at the end of the Zelda timeline; the player controls Link, who awakens from a hundred-year slumber to defeat Calamity Ganon before it can destroy the kingdom of Hyrule.\r\n\r\nSimilar to the original Legend of Zelda (1986), players are given little instruction and can explore the open world freely. Tasks include collecting multipurpose items to aid in objectives or solving puzzles and side quests for rewards. The world is unstructured and designed to reward experimentation, and the story can be completed in a nonlinear fashion.\r\n\r\nDevelopment of Breath of the Wild lasted five years. Wanting to reinvent the series, Nintendo introduced elements such as a detailed physics engine, high-definition visuals, and voice acting. Monolith Soft, known for their work in the open-world Xenoblade Chronicles series, assisted in designing landscapes and topography. The game was planned for release in 2015 as a Wii U exclusive, but was delayed twice due to problems with the physics engine. Breath of the Wild was a launch game for the Switch and the final game published by Nintendo for the Wii U. Two downloadable content packs were released later in 2017.',4,22,2017,'2020-03-25 17:59:22',NULL,'\0','\0'),(13,'Super Mario Odyssey','Super Mario Odysseyis a platform game developed and published by Nintendo for the Nintendo Switch on October 27, 2017. An entry in the Super Mario series, it follows Mario and Cappy, a sentient hat that allows Mario to control other characters and objects, as they journey across various worlds to save Princess Peach from his nemesis Bowser, who plans to forcibly marry her. In contrast to the linear gameplay of prior entries, the game returns to the primarily open-ended, exploration-based gameplay featured in Super Mario 64 and Super Mario Sunshine.\r\n\r\nThe game was developed by Nintendo\'s Entertainment Planning & Development division, and began development soon after the release of Super Mario 3D World in 2013. Various ideas were suggested during development, and to incorporate them all, the team decided to employ a sandbox-style of gameplay. Unlike previous installments such as New Super Mario Bros. and Super Mario 3D World, which were aimed at a casual audience, the team designed Super Mario Odyssey to appeal to the series\' core fans. The game also features a vocal theme song, \"Jump Up, Super Star!\", a first for the series.\r\n\r\nSuper Mario Odyssey received universal acclaim from critics who called it one of the best games in the series, as well as one of the greatest games of all time, with particular praise towards its inventiveness and originality. It also won numerous awards, including for game of the year. The game was also a commercial success, selling over 16.59 million copies by December 2019, which makes it one of the best-selling Switch games.',4,22,2017,'2020-03-25 18:01:03',NULL,'\0','\0'),(14,'Horizon Zero Dawn','Horizon Zero Dawn is an action role-playing game developed by Guerrilla Games and published by Sony Interactive Entertainment. The plot follows Aloy, a hunter in a world overrun by machines, who sets out to uncover her past. The player uses ranged weapons, a spear, and stealth to combat mechanical creatures and other enemy forces. A skill tree provides the player with new abilities and bonuses. The player can explore the open world to discover locations and take on side quests. It was released for the PlayStation 4 in 2017, and will be released for Microsoft Windows in mid-2020.\r\n\r\nHorizon Zero Dawn is Guerrilla Games\' first intellectual property since Killzone in 2004 and its first role-playing game. Development began in 2011 after the completion of Killzone 3, with director Mathijs de Jonge considering it the riskiest idea pitched at the time. The game engine, Decima, was developed for Killzone Shadow Fall and altered for Horizon Zero Dawn. Being set in a post-apocalyptic setting, anthropologists were consulted to authenticate the world\'s decay over a millennium. The soundtrack was led by composer Joris de Man, featuring contributions from The Flight.\r\n\r\nHorizon Zero Dawn was praised by critics for its open world, story, visuals, combat, characterisation, and the performance of voice actress Ashly Burch; however, the dialogue, melee combat, and character models received some criticism. The game won numerous awards and sold over 10 million copies by February 2019, making it one of the best-selling PlayStation 4 games. An expansion, The Frozen Wilds, was released in November 2017.',3,23,2017,'2020-03-25 18:02:55',NULL,'\0','\0'),(15,'Cuphead','Cuphead is a 2017 run and gun video game developed and published by the Canadian video game developer, StudioMDHR. The game was inspired by the rubber hose style of animation used in cartoons of the 1930s, such as the work of Fleischer Studios and Walt Disney Animation Studios, and sought to emulate their subversive and surrealist qualities.\r\n\r\nCuphead features one or two players taking control of animated characters Cuphead and his brother Mugman to fight through several levels that culminate in boss fights, in order to repay their debt to the devil. The game was praised for its art style and noted for its challenging difficulty. It was both a critical and commercial success, winning several awards and selling over five million copies within two years. An animated series based on the game is in production by Netflix.',16,24,2017,'2020-03-25 18:05:27',NULL,'\0','\0'),(17,'The Legend of Zelda: Ocarina of Time','The Legend of Zelda: Ocarina of Time is an action-adventure game developed and published by Nintendo for the Nintendo 64. It was released in Japan and North America in November 1998, and in PAL regions the following month. Ocarina of Time is the fifth game in The Legend of Zelda series, and the first with 3D graphics.\r\n\r\nThe player controls Link in the fantasy land of Hyrule on a quest to stop the evil king Ganondorf, traveling through time and navigating dungeons and an overworld. The game introduced features such as a target-lock system and context-sensitive buttons that have since become common in 3D adventure games. Music plays an important role, as the player must learn to play numerous songs on an ocarina to progress.\r\n\r\nOcarina of Time received widespread acclaim and won several awards and accolades, and has been widely cited as one of the greatest video games of all time, with numerous publications ranking it the greatest video game ever made. It was also commercially successful, selling over seven million copies worldwide. In the United States, it received more than three times more pre-orders than any other video game up to that point and was the best-selling game in the country that year. Ocarina of Time is the highest-rated game on review aggregator site Metacritic and the second highest-rated on GameRankings.',4,29,1998,'2020-03-25 18:09:06',NULL,'\0','\0'),(18,'The Elder Scrolls 5: Skyrim','The Elder Scrolls V: Skyrim is an action role-playing video game developed by Bethesda Game Studios and published by Bethesda Softworks. It is the fifth main installment in The Elder Scrolls series, following The Elder Scrolls IV: Oblivion, and was released worldwide for Microsoft Windows, PlayStation 3, and Xbox 360 on November 11, 2011.\r\n\r\nThe game\'s main story revolves around the player\'s character, the Dragonborn, on their quest to defeat Alduin the World-Eater, a dragon who is prophesied to destroy the world. The game is set 200 years after the events of Oblivion and takes place in Skyrim, the northernmost province of Tamriel. Over the course of the game, the player completes quests and develops the character by improving skills. The game continues the open-world tradition of its predecessors by allowing the player to travel anywhere in the game world at any time, and to ignore or postpone the main storyline indefinitely.\r\n\r\nSkyrim was developed using the Creation Engine, rebuilt specifically for the game. The team opted for a unique and more diverse open world than Oblivion\'s Imperial Province of Cyrodiil, which game director and executive producer Todd Howard considered less interesting by comparison. The game was released to critical acclaim, with reviewers particularly mentioning the character advancement and setting, and is considered to be one of the greatest video games of all time. Nonetheless it received some criticism, predominantly for its melee combat and numerous technical issues present at launch. The game shipped over seven million copies to retailers within the first week of its release, and over 30 million copies on all platforms as of November 2016, making it one of the best selling video games in history.',18,44,2011,'2020-03-25 18:12:49',NULL,'\0','\0'),(19,'Grand Theft Auto 5','Grand Theft Auto V is a 2013 action-adventure game developed by Rockstar North and published by Rockstar Games. It is the first main entry in the Grand Theft Auto series since 2008\'s Grand Theft Auto IV. Set within the fictional state of San Andreas, based on Southern California, the single-player story follows three criminals and their efforts to commit heists while under pressure from a government agency and powerful crime figures. The open world design lets players freely roam San Andreas\' open countryside and the fictional city of Los Santos, based on Los Angeles.\r\n\r\nThe game is played from either a third-person or first-person perspective, and its world is navigated on foot or by vehicle. Players control the three lead protagonists throughout single-player and switch among them, both during and outside missions. The story is centred on the heist sequences, and many missions involve shooting and driving gameplay. A \"wanted\" system governs the aggression of law enforcement response to players who commit crimes. Grand Theft Auto Online, the game\'s online multiplayer mode, lets up to 30 players engage in a variety of different cooperative and competitive game modes.',1,45,2013,'2020-03-25 18:16:46',NULL,'\0','\0'),(20,'Red Dead Redemption','Red Dead Redemption is a Western action-adventure game developed by Rockstar San Diego and published by Rockstar Games. A spiritual successor to 2004\'s Red Dead Revolver, it is the second game in the Red Dead series, and was released for the PlayStation 3 and Xbox 360 in May 2010. Red Dead Redemption is set during the decline of the American frontier in the year 1911 and follows John Marston, a former outlaw whose wife and son are taken hostage by the government in ransom for his services as a hired gun. Having no other choice, Marston sets out to bring three members of his former gang to justice.\r\n\r\nThe game is played from a third-person perspective in an open world, allowing the player to interact with the game world at their leisure. The player can travel the virtual world, a fictionalized version of the Western United States and Mexico, primarily by horseback and on foot. Gunfights emphasize a gunslinger gameplay mechanic called \"Dead Eye\" that allows players to mark multiple shooting targets on enemies in slow motion. The game makes use of a morality system, by which the player\'s actions in the game affect their character\'s levels of honor and fame and how other characters respond to the player. An online multiplayer mode is included with the game, allowing up to 16 players to engage in both cooperative and competitive gameplay in a recreation of the single-player setting.',1,46,2010,'2020-03-25 18:25:21',NULL,'\0','\0'),(21,'Halo 3','Halo 3 is a 2007 first-person shooter game developed by Bungie for the Xbox 360 console. The third installment in the Halo franchise, the game concludes the story arc begun in 2001\'s Halo: Combat Evolved and continued in 2004\'s Halo 2. Halo 3\'s story centers on the interstellar war between twenty-sixth century humanity, a collection of alien races known as the Covenant, and the alien parasite Flood. The player assumes the role of the Master Chief, a cybernetically enhanced supersoldier, as he battles the Covenant and the Flood. The game features vehicles, weapons, and gameplay elements not present in previous titles of the series, as well as the addition of saved gameplay films, file sharing, and the Forge map editor—a utility which allows the player to perform modifications to multiplayer levels.\r\n\r\nBungie began developing Halo 3 shortly after Halo 2 shipped. The game was officially announced at E3 2006, and its release was preceded by a multiplayer beta open to select players who purchased the Xbox 360 game Crackdown. Microsoft spent $40 million on marketing the game, in an effort to sell more game consoles and broaden the appeal of the game beyond the established Halo fanbase. Marketing included cross-promotions and an alternate reality game. The game was released in September 2007.',6,47,2007,'2020-03-25 18:27:17',NULL,'\0','\0'),(22,'Persona 5','Persona 5 is a role-playing video game developed by Atlus. The game is chronologically the sixth installment in the Persona series, which is part of the larger Megami Tensei franchise. It was released for the PlayStation 3 and PlayStation 4 in Japan in September 2016 and worldwide in April 2017, where it was published by Atlus in Japan and North America and by Deep Silver in Europe and Australia. An expanded version featuring new content, Persona 5 Royal,[b] was released in Japan in October 2019 and will be released worldwide in March 2020.\r\n\r\nPersona 5 takes place in modern-day Tokyo and follows Joker after his transfer to Shujin Academy due to being put on probation for an assault of which he was falsely accused. During a school year, he and other students awaken to special powers, becoming a group of secret vigilantes known as the Phantom Thieves of Hearts. They explore the Metaverse, a supernatural realm born from humanity\'s subconscious desires, to steal malevolent intent from the hearts of adults. As with previous games in the series, the party battles enemies known as Shadows using physical manifestations of their psyche known as the Persona. The game incorporates role-playing and dungeon crawling elements alongside social simulation scenarios.\r\n\r\nPersona 5 was developed by P-Studio, an internal development studio within Atlus led by game director and producer Katsura Hashino. Along with Hashino, returning staff from earlier Persona games included character designer Shigenori Soejima and music composer Shoji Meguro. Preparatory work began during the development of Persona 4, with full development beginning after the release of Catherine in 2011. First announced in 2013, Persona 5 was delayed from its original late 2014 release date due to the game not being fully finished. The game\'s themes revolved around attaining freedom from the limitations of modern society, while its story was strongly inspired by picaresque fiction and the party\'s Personas being based on well-known literary outlaws and rebels.',17,25,2016,'2020-03-25 18:29:09',NULL,'','\0'),(23,'Super Mario Bros.','Super Mario Bros. is a platform game developed and published by Nintendo. The successor to the 1983 arcade game, Mario Bros., it was released in Japan in 1985 for the Famicom, and in North America and Europe for the Nintendo Entertainment System (NES) in 1985 and 1987 respectively. Players control Mario, or his brother Luigi in the multiplayer mode, as they travel the Mushroom Kingdom to rescue Princess Toadstool from Bowser. They must traverse side-scrolling stages while avoiding hazards such as enemies and pits with the aid of power-ups such as the Super Mushroom, Fire Flower, and Starman.\r\n\r\nThe game was designed by Shigeru Miyamoto and Takashi Tezuka as \"a grand culmination\" of the Famicom team\'s three years of game mechanics and programming. The design of the first level, World 1-1, serves as a tutorial for first-time video gamers on the basic mechanics of platform gameplay. The aggressively size-optimized profile was intended as a farewell to the Famicom\'s cartridge medium in favor of the forthcoming Famicom Disk System, whose floppy disks temporarily became the dominant distribution medium for a few years.\r\n\r\nSuper Mario Bros. is frequently cited as one of the greatest video games of all time, with praise on its precise controls. It is one of the bestselling games of all time, with more than 40 million physical copies. It is credited alongside the NES as one of the key factors in reviving the video game industry after the 1983 crash, and helped popularize the side-scrolling platform game genre. Koji Kondo\'s soundtrack is one of the earliest and most popular in video games, making music into a centerpiece of game design. The game inspired an expansive franchise including a long-running game series, an animated television series, and a feature film. Re-releases and cameos of the game are on most of Nintendo\'s following systems. Alongside Mario himself, Super Mario Bros. has become prominent in popular culture.',4,29,1985,'2020-03-25 18:34:22',NULL,'\0','\0'),(24,'Nier: Automata','Nier: Automatais a 2017 action role-playing video game developed by PlatinumGames and published by Square Enix. It is a sequel to the 2010 video game Nier, itself a spin-off and sequel of the Drakengard series. The game originally released for the PlayStation 4 and Microsoft Windows via Steam, with an Xbox One port being published the following year.\r\n\r\nSet during a proxy war between alien-created machines and human-crafted androids, the story follows the trials of a combat android, her companion, and a fugitive prototype. The story requires multiple playthroughs, each unlocking additional story elements. Gameplay combines role-playing elements with action-based hack and slash combat, and features switches between video game genres similar to that of Nier with elements ranging from shoot \'em up to text adventure.\r\n\r\nProduction began in 2014, with series creator Yoko Taro, producer Yosuke Saito, and lead composer Keiichi Okabe returning to their respective roles, as well as Square Enix artist Akihiko Yoshida in charge of character design. The goal was to make a Nier game true to the spirit of the original, while simultaneously crafting a better combat system. As a project entirely new to the developers, the staff at PlatinumGames faced multiple challenges when developing its gameplay and open world environment. The story, written by Yoko, references several philosophies and explores themes of finding value in life and the reasons people kill.',15,9,2017,'2020-03-25 18:37:13',NULL,'\0','\0'),(25,'Wolfenstein II: The New Colossus','Wolfenstein II: The New Colossus is an action-adventure first-person shooter video game developed by MachineGames and published by Bethesda Softworks. It was released on 27 October 2017 for Microsoft Windows, PlayStation 4, and Xbox One, and was released on 29 June 2018 for Nintendo Switch. The eighth main entry in the Wolfenstein series and the sequel to 2014\'s Wolfenstein: The New Order, the game is set in an alternate history which takes place in 1961 following the Nazi victory in the Second World War. The story follows war veteran William \"B.J.\" Blazkowicz and his efforts to fight against the Nazi regime in the United States.\r\n\r\nThe game is played from a first-person perspective and most of its levels are navigated on foot. The story is arranged in chapters, which players complete in order to progress. A binary choice in the prologue alters the game\'s entire storyline; some characters and small plot points are replaced throughout the timelines. The game features a variety of weapons, most of which can be dual wielded. A cover system is also present. Continuing from The New Order, the development team aimed to characterize Blazkowicz for players to adopt his personality.\r\n\r\nWolfenstein II: The New Colossus was released to a positive critical response. Particular praise was directed at the characters, narrative, shooting mechanics, as well as the general presentation of the game. The game was nominated for multiple year-end awards, including nominations at the 35th Annual Golden Joystick Awards[1] and The Game Awards 2017, the latter in which it received the accolade for \"Best Action Game\".',18,26,2017,'2020-03-25 18:39:43',NULL,'\0','\0'),(26,'Crash Bandicoot N. Sane Trilogy','Crash Bandicoot N. Sane Trilogy is a platform game developed by Vicarious Visions and published by Activision. It is a compilation of remasters of the first three games in the Crash Bandicoot series: Crash Bandicoot (1996), Cortex Strikes Back (1997), and Warped (1998); all which were originally developed by Naughty Dog for the PlayStation during the late 1990s. The game was first released for PlayStation 4 in June 2017, with versions for Microsoft Windows, Nintendo Switch, and Xbox One being released in June 2018. It received positive reviews from critics, and sold over 10 million copies by February 2019.',10,27,2017,'2020-03-25 18:41:32',NULL,'\0',''),(27,'Sekiro: Shadows Die Twice','Sekiro: Shadows Die Twice is an action-adventure video game developed by FromSoftware and published by Activision. The game takes place in the Sengoku period in Japan, and follows a shinobi known as Wolf as he attempts to take revenge on a samurai clan who attacked him and kidnapped his lord. It was released for Microsoft Windows, PlayStation 4, and Xbox One on 22 March 2019.\r\n\r\nGameplay is focused on stealth, exploration, and combat, with a particular emphasis on boss battles. Although most of the game takes place in fictional areas, some areas are inspired by real-world buildings and locations in Japan. The game also makes strong references to Buddhist mythology and philosophy. While creating the game, director Hidetaka Miyazaki wanted to create a new intellectual property (IP) that marked a departure from the Souls series of games also made by FromSoftware, and looked to series such as The Mysterious Murasame Castle and Tenchu for inspiration.\r\n\r\nSekiro received universal acclaim from critics, who commonly compared and contrasted it to the Souls games. While its high level of difficulty received some criticism, praise was directed toward its gameplay and setting. By August 2019, the game had shipped 3.8 million copies worldwide. It was also nominated for and won several awards and accolades, including game of the year.',10,5,2019,'2020-03-25 18:44:20',NULL,'','\0'),(28,'Resident Evil 7: Biohazard','Resident Evil 7: Biohazard is a survival horror game developed and published by Capcom, released in January 2017 for Windows, PlayStation 4, and Xbox One, and in May 2018 for the Nintendo Switch in Japan. Diverging from the more action-oriented Resident Evil 5 and Resident Evil 6, Resident Evil 7 returns to the franchise\'s survival horror roots, emphasizing exploration. The player controls Ethan Winters as he searches for his wife in a derelict plantation occupied by a cannibal family, solving puzzles and fighting enemies. It is the first main series game to use a first-person view.\r\n\r\nResident Evil 7 is the first full-length game to use Capcom\'s in-house RE Engine. The development was led by Koshi Nakanishi, director of the 2012 Nintendo 3DS game Resident Evil: Revelations. It was presented as a virtual reality demo, Kitchen, a year prior to its announcement at E3 2016, and supports the PlayStation VR headset. Resident Evil 7 was considered a return to form for the series; critics praised the gameplay, graphics, and design, but criticized the boss battles and the final chapter. The PlayStation VR version received positive reviews, with some criticism including decreased resolution and physical discomfort. As of December 2018, the game has sold over six million copies worldwide. Two downloadable content scenarios, Not a Hero and End of Zoe, were also released for the game.',11,4,2017,'2020-03-25 18:49:48',NULL,'\0','\0'),(29,'The Talos Principle','The Talos Principle is a first-person puzzle video game created by the Croatian developer Croteam and published by Devolver Digital. It was simultaneously released on Linux, OS X and Windows in December 2014. It was released for Android in May 2015, for PlayStation 4 in October 2015, for iOS in October 2017, for Xbox One in August 2018, and Nintendo Switch in December 2019. Virtual reality-enabled versions for the Oculus Rift and HTC Vive were released on 18 October 2017.\r\n\r\nThe game features a philosophical storyline. It takes its name from Talos of Greek mythology, a giant mechanical man who protected Europa in Crete from pirates and invaders. Other names taken from mythology and religion and used in the game include Elohim, Gehenna, Milton, Samsara, and Uriel.',28,18,2014,'2020-03-25 18:52:22',NULL,'\0','\0'),(30,'Sonic Mania','Sonic Mania is a 2017 platform game published by Sega for Nintendo Switch, Xbox One, PlayStation 4, and Windows. Produced in commemoration of the Sonic the Hedgehog series\' 25th anniversary, Sonic Mania homages the original Sega Genesis Sonic games, featuring speedy side-scrolling gameplay. It takes place over twelve levels, including eight redesigned stages from past games. The story follows Sonic the Hedgehog and his companions Tails and Knuckles as they venture to defeat their nemesis Doctor Eggman and his robotic henchmen, the Hard-Boiled Heavies.\r\n\r\nThe development team was composed of members known for their work in the Sonic fangame and ROM hacking community. Development began after lead developer Christian \"Taxman\" Whitehead, who was previously contracted by Sega to develop enhanced mobile ports of Genesis Sonic games, presented a playable prototype to Sonic Team producer Takashi Iizuka. Art, level design, audio, and additional programming was provided by independent studios PagodaWest Games and Headcannon. The team used Whitehead\'s Retro Engine and aimed for a graphical quality between Genesis and Sega Saturn games.\r\n\r\nSonic Mania was released in August 2017. Many reviewers saw it as a return to form for the Sonic series following a number of poorly received games released after the 1990s; its presentation, level design, music, and faithfulness to the early Sonic games were praised, but its lack of originality was criticized. Several described it as one of the best Sonic games and one of the best games of 2017. Within a year, it had sold over one million copies worldwide across all platforms. Sonic Mania Plus, an enhanced version with additional content, was released in July 2018.',19,28,2017,'2020-03-25 18:56:47',NULL,'','\0'),(31,'Fallout: New Vegas','Fallout: New Vegas is a post-apocalyptic action role-playing video game. It is a spin-off of the Fallout series and was developed by Obsidian Entertainment and published by Bethesda Softworks. It was announced in April 2009 and released for Microsoft Windows, PlayStation 3 and Xbox 360 on October 19, 2010. The game is set in a post-apocalyptic open world environment that encompasses a region consisting of parts of Nevada, California, and Arizona. It is set in a world that deviated onto an alternate timeline thanks to atomic age technology, which eventually led to its devastation by a nuclear apocalypse in the year 2077 in an event referred to as \"The Great War\". This war was caused by a major international conflict between the United States and China over natural resources. The main story of New Vegas takes place in the year 2281, four years after the events of Fallout 3. It is not a direct sequel, but it does mark the return of several elements found in the Black Isle Studios-developed Fallout 2.\r\n\r\nPlayers take control of a character known as the Courier. While transporting a package across the Mojave Desert to the city of New Vegas, the Courier is ambushed, robbed of the package, shot in the head, and left for dead. After surviving, the Courier begins a journey to find their would-be killer and recover the package, makes friends and enemies among various factions, and ultimately becomes caught up in a conflict that determines who will control New Vegas and the Mojave Wasteland. New Vegas received positive reviews, with critics praising the game\'s writing, quests, and improved gameplay, though criticized for its glitches and bugs on launch. New Vegas was a commercial success, shipping more than 5 million copies altogether, and is estimated to have sold around 12 million copies worldwide. The game also received a Golden Joystick Award for \"RPG of the Year\" in 2011 and was also nominated for two BAFTA awards in Best Strategy Game and Story, as well as a NAVGTR Award in Supporting Performance in a Drama (Felicia Day).',18,8,2010,'2020-03-25 18:58:27',NULL,'','\0'),(32,'Injustice 2','Injustice 2 is a 2017 fighting video game based upon the DC Universe. It was developed by NetherRealm Studios and published by Warner Bros. Interactive Entertainment. It is the sequel to 2013\'s Injustice: Gods Among Us. The game was initially released in May 2017 for the PlayStation 4 and Xbox One; a Microsoft Windows version was released later in November 2017. An expanded version of the game, titled Injustice 2: Legendary Edition, was released in March 2018 for the PlayStation 4, Xbox One, and Microsoft Windows. Similar to the previous installment, a companion mobile app was released for Android and iOS devices. A prequel comic book series of the same name, written by Tom Taylor, was also released beginning in April 2017.\r\n\r\nThe core gameplay remains similar to its predecessor, albeit with minor adjustments to returning game mechanics. Injustice 2 introduces a new feature called the Gear System, a loot-dropping system that rewards players with costume pieces and equipment that can be used to customize characters\' appearances and modify their abilities and stats. According to developers, the idea for implementing a role playing game (RPG)-style progression system into a fighting game had existed since before the fall of Midway Games, the original publisher for the Mortal Kombat series. Director Ed Boon also sought to incorporate gameplay mechanics used by multiplayer shooter games, such as personalization, character creation, loot, and leveling up, into the fighting game genre, which led to the development of the Gear System.\r\n\r\nInjustice 2\'s storyline centers around Batman and his insurgency\'s attempt to restore society after the fall of Superman\'s regime; however, the arrivals of the newly formed supervillain group \"The Society\" and the alien Brainiac forces Batman to consider freeing the imprisoned Superman to help combat the threats. The game received positive reviews from critics, who praised its story, presentation, improved gameplay mechanics, abundance of in-game content, and character customization options, while criticizing its random loot and microtransaction systems.',12,6,2017,'2020-03-25 19:00:20',NULL,'\0',''),(33,'Super Smash Bros. Brawl','Super Smash Bros. Brawl is a crossover fighting video game developed by Sora Ltd. and Game Arts and published by Nintendo for the Wii. The third installment in the Super Smash Bros. series, it was announced at a pre-E3 2005 press conference by Nintendo president Satoru Iwata. Masahiro Sakurai, director of the previous two games in the series, assumed the role of director at Iwata\'s request. Game development began in October 2005 with a creative team that included members from several Nintendo and third-party development teams. After delays due to development problems, the game was released worldwide in 2008.\r\n\r\nThe number of playable characters in Brawl has grown from that in Super Smash Bros. Melee, although some characters from Melee were cut in Brawl. Brawl is the first game in the series to have playable third-party characters. Like that of its predecessors, the objective of Brawl is to knock opponents off the screen. It is a departure from traditional fighting games, notably in its simplified move commands and emphasis on ring outs over knockouts. It includes a more extensive single-player mode than its predecessors, known as the Subspace Emissary. This mode is a plot-driven, side-scrolling beat \'em up featuring computer-generated cut scenes. Brawl supports multiplayer battles with up to four combatants, and is the first game of its franchise to feature online battles via Nintendo Wi-Fi Connection. The game is unique in that it can be played with four different controllers, including the Wii Remote, Wii Remote with Nunchuk, GameCube controller, and Classic Controller, simultaneously.',4,21,2008,'2020-03-25 19:34:20',NULL,'\0','\0'),(34,'Mario Kart 8 Deluxe','Mario Kart 8 Deluxe is a racing game for the Nintendo Switch, and the first Mario game overall for the console. It is a port in the Mario Kart series, being a port of Mario Kart 8 from the Wii U. It has additional features such as several new characters and features more options for Battle Mode. First teased in the Switch\'s announcement video on October 20, 2016, the game was formally announced as part of the Nintendo Switch presentation on January 13, 2017.',4,29,2017,'2020-03-25 19:37:54',NULL,'\0','\0'),(35,'Doki Doki Literature Club!','Doki Doki Literature Club! is a 2017 American visual novel developed by Team Salvato for Microsoft Windows, macOS, and Linux. The game was initially distributed through itch.io, and later became available on Steam. The story follows a male high school student who joins the school\'s literature club and interacts with its four female members. The game features a mostly linear story, with some alternative scenes and endings depending on the choices the player makes. While the game appears at first glance to be a lighthearted dating simulator, it is in fact a metafictional psychological horror game that extensively breaks the fourth wall.\r\n\r\nThe game was developed in an estimated two-year period by a team led by Dan Salvato, known previously for his modding work for Super Smash Bros. Melee. According to Salvato, the inspiration for the game came from his mixed feelings toward anime and a fascination for surreal and unsettling experiences. Upon its release, Doki Doki Literature Club! received positive critical attention for its successful use of horror elements and unconventional nature within the visual novel genre.',20,30,2017,'2020-03-25 19:40:45',NULL,'\0','\0'),(36,'Mortal Kombat 11','Mortal Kombat 11 is a fighting game developed by NetherRealm Studios and published by Warner Bros. Interactive Entertainment. Running on a heavily modified version of Unreal Engine 3, it is the eleventh main installment in the Mortal Kombat series and a sequel to 2015\'s Mortal Kombat X. Announced at The Game Awards 2018, the game was released in North America and Europe on April 23, 2019 for Microsoft Windows, Nintendo Switch, PlayStation 4, and Xbox One. The Switch version was delayed in Europe, and was released on May 10, 2019.[8]\r\n\r\nUpon release, the console versions of Mortal Kombat 11 received generally favorable reviews, which praised the gameplay, story, graphics and improved netcode, but it received criticism for the presence of microtransactions and over-reliance on grinding.',12,6,2018,'2020-03-25 19:42:53',NULL,'\0','\0'),(37,'Metro Exodus','Metro Exodus is a first-person shooter video game developed by 4A Games and published by Deep Silver in 2019. It is the third installment in the Metro video game series based on Dmitry Glukhovsky\'s novels, following the events of Metro 2033 and Metro: Last Light. The game received generally positive reviews from critics.\r\n\r\nMetro Exodus is a first-person shooter game with survival horror and stealth elements. Set in the post-apocalyptic wasteland of the former Russian Federation, the player must cope with the new hazards and engage in combat against mutated creatures as well as hostile humans. The player wields an arsenal of hand-made weaponry which can be customised through scavenging materials and a crafting system. The game features a mixture of linear levels and sandbox environments. It also includes a dynamic weather system, a day-night cycle, and environments that change along with the seasons as the story progresses. It is set over the course of one whole in-game year',13,7,2019,'2020-03-25 19:45:49',NULL,'\0','\0'),(38,'Watch Dogs 2','Watch Dogs 2 (stylized as WATCH_DOGS 2) is a 2016 action-adventure game developed by Ubisoft Montreal and published by Ubisoft. It is the sequel to 2014\'s Watch Dogs and was released for the PlayStation 4, Xbox One and Microsoft Windows. Set within a fictionalized version of the San Francisco Bay Area, the game is played from a third-person perspective and its open world is navigated on-foot or by vehicle. Players control Marcus Holloway, a hacker who works with the hacking group DedSec to take down the city\'s advanced surveillance system known as ctOS. There are multiple ways to complete missions, and each successful assignment increases the follower count of DedSec. Cooperative multiplayer allows for competitive one-on-one combat and connecting with other players to neutralize a player who is causing havoc.\r\n\r\nUbisoft Montreal studied player feedback from the first game to assess what could be improved in Watch Dogs 2 and the setting was researched by making frequent trips to California. Ubisoft Reflections was responsible for overhauling the driving mechanic. Real hackers were consulted to validate scripts and game mechanics for authenticity and references to real-life hacktivism were fictionalized, like the Project Chanology protest. The original soundtrack was composed by Hudson Mohawke. The game was released to overall positive reception from critics which praised the game for improving upon the original Watch Dogs in areas like the hacking, setting, characters and driving. However, character inconsistencies, firearms, and frequent technical issues – later patched – were cited as imperfections. A sequel, Watch Dogs: Legion, is in development.',5,15,2016,'2020-03-25 19:47:52',NULL,'\0','\0'),(39,'Dragon Ball Xenoverse 2','Dragon Ball Xenoverse 2 is a role-playing video game developed by Dimps and published by Bandai Namco Entertainment based on the Dragon Ball franchise, and a sequel to the 2015 game Dragon Ball Xenoverse. It was released in October 25, 2016 for PlayStation 4, Xbox One and on October 27 for Microsoft Windows. In Japan, Dragon Ball Xenoverse 2 was initially only available on PlayStation 4. The game was released for the Nintendo Switch in Japan on September 7, 2017 and later released worldwide on September 22, 2017. It was produced and developed by Bandai, QLOC, and Dimps.',7,42,2017,'2020-03-25 19:49:58','2020-03-27 14:32:28','','\0'),(40,'Pokémon Sword and Shield','Pokémon Sword (Japanese: ポケットモンスター ソード Pocket Monsters Sword) and Pokémon Shield (Japanese: ポケットモンスター シールド Pocket Monsters Shield) are the primary paired versions of Generation VIII. The games were released on the Nintendo Switch worldwide on November 15, 2019 for both retail sale and download. All copies of the game are playable in nine languages: Japanese, English, German, Spanish, French, Italian, Korean, Simplified and Traditional Chinese.\r\n\r\nDuring E3 2017, Tsunekazu Ishihara announced that the next core series titles would be available on the Nintendo Switch, but they were not prepared to release any more information at the time. On May 30, 2018, The Pokémon Company gave a press conference and announced that the new core games would have more traditional gameplay, as opposed to that found in Pokémon: Let\'s Go, Pikachu! and Let\'s Go, Eevee!.\r\n\r\nThe games were formally announced on Pokémon Day, February 27, 2019 at 11 pm JST during a worldwide announcement through Nintendo Direct hosted by Tsunekazu Ishihara, Junichi Masuda, and Shigeru Ohmori. An official trailer was shown, giving information on the region and the starter Pokémon players can choose from.\r\n\r\nThe Pokémon Sword and Shield Expansion Pass was revealed during a Pokémon Direct on January 9, 2020; it adds two new post-game areas to the game, The Isle of Armor and The Crown Tundra.',4,34,2019,'2020-03-25 19:54:06',NULL,'\0','\0'),(41,'For Honor','For Honor is a 2017 action video game developed and published by Ubisoft for Microsoft Windows, PlayStation 4, and Xbox One. The game allows players to play the roles of historical forms of soldiers and warriors, including knights, samurai, vikings and since October 2018 the Chinese Wu Lin, within a medieval setting, controlled using a third-person perspective. The game was developed primarily by Ubisoft Montreal and released worldwide in 2017.',5,15,2017,'2020-03-25 19:56:07',NULL,'\0','\0'),(42,'Prey','Prey is a first-person shooter video game developed by Arkane Studios and published by Bethesda Softworks. The game was released worldwide on 5 May 2017, for Microsoft Windows, PlayStation 4 and Xbox One.\r\n\r\nIn Prey, the player controls Morgan Yu while exploring the space station Talos I, in orbit around Earth–Moon L2, where they had been researching a hostile alien species called the Typhon. As the Typhon escape confinement, the player uses a variety of weapons and abilities derived from the Typhon to avoid being killed by the aliens while looking to escape the station. The player gains access to areas of the station by acquiring key items and abilities, eventually allowing the player to fully explore the station in an open world setting.\r\n\r\nArkane\'s Prey is largely unrelated to the 2006 game Prey developed by Human Head Studios, and is considered a reimagining of the intellectual property set in a wholly new narrative. While Prey 2, a sequel to the 2006 game, had been planned by Human Head, it fell into development hell following transfer of the intellectual property from 3D Realms to Bethesda Softworks, and was eventually cancelled in 2014. Arkane\'s game does not use any of the planned sequel\'s assets, and only incorporates the previous game\'s name and the broad theme of the protagonist being hunted by aliens. Arkane built Prey as a spiritual sequel to System Shock, providing the player with several potential means of progressing within the game.',18,32,2017,'2020-03-25 19:57:27',NULL,'\0','\0'),(43,'Devil May Cry 5','Devil May Cry 5 is an action-adventure hack and slash video game developed and published by Capcom. It is the sixth installment in the franchise and the fifth installment of the mainline Devil May Cry series. Capcom released it for Microsoft Windows, PlayStation 4, and Xbox One on 8 March 2019. The game takes place five years after Devil May Cry 4 and follows a trio of warriors with demonic powers: Dante, Nero and a new protagonist named V as they attempt to stop the Demon King Urizen from destroying the human world. Across the game, the player can use these characters in different missions. Each of them has their own way of fighting and becoming stronger. As this happens, the mystery behind V is revealed along with his connection with Urizen.\r\n\r\nDevil May Cry 5 was directed by Hideaki Itsuno whose goal was for this installment to be his best work. He aimed to make the game balanced for both newcomers and returning gamers by providing adequate, difficult and new demons. Capcom also wanted to bring a more realistic design inspired by the \"RE Engine\" used in their previous work, Resident Evil 7: Biohazard. As a result, models were used to make the character\'s faces. The plot was written by returning writer Bingo Morihashi while the setting was based on various locations in London. Multiple composers worked together to produce the game\'s audio, creating three main themes centered around the playable characters.\r\n\r\nDevil May Cry 5 received positive reviews from critics. Many lauded it as a return to form for the franchise, praising the variety of techniques the three characters bring. The game had sold over two million copies less than two weeks after its release. A light novel and manga related to the game have also been released.',11,4,2019,'2020-03-25 19:58:57',NULL,'\0',''),(44,'Hollow Knight','Hollow Knight is a 2017 Metroidvania style video game. It was developed and published by Team Cherry. The game was released for Microsoft Windows, macOS, and Linux in 2017, and for the Nintendo Switch, PlayStation 4, and Xbox One in 2018.[1] Development was partially funded through a Kickstarter crowdfunding campaign, raising over A$57,000 by the end of 2014.[2]\r\n\r\nThe game tells the story of an insectoid Knight on a quest to uncover the secrets of the long-abandoned insect kingdom of Hallownest, whose haunting depths draw in the adventurous and brave with promises of treasures and answers to ancient mysteries. To progress through the game, the Knight must traverse areas in a nonlinear fashion, as well as find and fight bosses, which grant them additional abilities.\r\n\r\nHollow Knight was well-received. A sequel, Hollow Knight: Silksong, is in development.',22,33,2017,'2020-03-25 20:04:24',NULL,'','\0'),(45,'The Outer Worlds','The Outer Worlds is an action role-playing game developed by Obsidian Entertainment and published by Private Division. The game was released for PlayStation 4, Xbox One, and Microsoft Windows on October 25, 2019, with a Nintendo Switch version to be released at a later time. The game received generally favorable reviews from critics. The Outer Worlds is an action role-playing video game featuring a first-person perspective. In the early stages of the game, the player can create their own character and unlock a ship, which acts as the game\'s central hub space. Though the player cannot control their ship directly, it serves as a fast travel point to access different areas in the game and acts as the player\'s persistent inventory space. The player can encounter and recruit non-player characters as companions who have their own personal missions and stories. When accompanying the player, the companions act as an aid in combat. Each companion has its own individual skills and special attacks, and it can also develop its own skill specialization. When exploring, the player can bring up to two companions alongside them, while the rest stay on the ship. The player can make numerous dialogue decisions, which can influence the game\'s branching story. They can also respond to NPCs in various ways, such as acting heroically, maniacally, or moronically.',14,8,2019,'2020-03-25 20:06:48',NULL,'\0','\0'),(46,'Forza Motorsport 7','Forza Motorsport 7 is a racing video game developed by Turn 10 Studios and published by Microsoft Studios, serving as the tenth installment in the Forza series. It was released on Windows 10 and the Xbox One family of consoles on October 3, 2017, with early access to those players pre-ordered the game\'s Ultimate and Deluxe editions. Forza Motorsport 7 is a racing video game featuring over 700 cars—including new Forza Edition cars, most of which have been brought over from Forza Horizon 3—and more than 200 different configurations to race on across 32 locations at launch, including all from Forza Motorsport 6; a fictional street circuit in Dubai is one of the new circuits and several tracks returning from Forza Motorsport 4 including Maple Valley Raceway, Mugello Circuit and Suzuka Circuit.[4] Two features that are new to the Motorsport title include dynamic weather (previously seen in Horizon titles) and customisable drivers.',6,35,2017,'2020-03-25 20:09:00',NULL,'\0','\0'),(47,'A Hat in Time','A Hat in Time is a platform action-adventure game developed by Gears for Breakfast and published by Humble Bundle. The game was developed using Unreal Engine 3 and funded through a Kickstarter campaign, which doubled its fundraising goals within its first two days. It is inspired by earlier 3D platformers such as Super Mario 64, Banjo-Kazooie, Spyro the Dragon and Psychonauts. The game was self-published for Microsoft Windows and macOS in October 2017, and by Humble Bundle for the PlayStation 4 and Xbox One consoles two months later. A version for the Nintendo Switch was released in October 2019.',24,36,2017,'2020-03-25 20:13:28',NULL,'','\0'),(48,'Astral Chain','Astral Chain is an action-adventure hack and slash video game developed by PlatinumGames and published by Nintendo for Nintendo Switch. It is directed by Takahisa Taura who was previously lead game designer for Nier: Automata, under supervision by Devil May Cry and Bayonetta series creator Hideki Kamiya, and character designs from manga artist Masakazu Katsura. It was released on August 30, 2019. As of December 2019, the game garnered positive reviews and sold over a million copies worldwide, making it one of the best-selling games on the system.',4,9,2019,'2020-03-25 20:16:10',NULL,'\0','');
